import React from 'react';
import { List } from 'antd';
import 'antd/dist/antd.css';

const preData = [
    {
        title: "Type1",
        type: "new1",
        date: "08/11/2019",
        revenue: 10000000,
    },
    {
        title: "Type2",
        type: "new2",
        date: "09/11/2019",
        revenue: 11000000,
    },
    {
        title: "Type3",
        type: "new3",
        date: "10/11/2019",
        revenue: 12000000,
    },
    {
        title: "Type4",
        type: "new4",
        date: "11/11/2019",
        revenue: 13000000,
    },
]

